import React from 'react';
import {Link} from "react-router-dom";

const FigureItem = () => {
  return (
    <div
      className="card"
    >
      <div className="img-manga">
        <img className="card-img-top" src="./Uploads/figure/cold-girl.png" alt=""/>
      </div>
      <div className="card-body item-manga-content">
        <Link to="/" className="title-manga">
          <p className="card-text">Boku Girl Boku Girl</p>
        </Link>
        <p className="price-manga">35.000</p>
      </div>
    </div>
  );
};

export default FigureItem;
